import React from 'react';
import styles from './../styles/mainPage.scss';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from "react-router-dom";
import Drinkerator from "./drinkeratorApp";
import Gallery from "./galleryApp";
import Portfolio from "./portfolio";
import WorkRelated from "./workRelated";

const MainPage = () => (
  <Router>
  <div className = {styles}>
    <div className = "project-container">
    <Link to = "/drinkerator">
    <div className = "project project-1"></div>
    </Link>
    <Link to = "/gallery"> <div className = "project project-2"></div></Link>

    <Link to = "/workrelated"> <div className = "project project-3"></div></Link>

    <Link to = "/portfolio"><div className = "project project-4"></div></Link>

    </div>
  </div>

  <Switch>
    <Route exact path = "/drinkerator">
    <Drinkerator/>
    </Route>
    <Route exact path = "/gallery">
    <Gallery/>
</Route>
<Route exact path = "/workrelated">
    <WorkRelated/>
    </Route>
    <Route exact path = "/portfolio">
    <Portfolio/>
    </Route>

  </Switch>
  </Router>
);

export default MainPage;
